import { Paper, Stack } from "@mui/material";
import { Header } from "./Header";
import { InputFile } from "./InputFile";
import { makeStyles } from "@mui/styles";
import { TextInput } from "./TextInput";
import setBodyColor from "./setBody";
import { ButtonClick } from "./ButtonClick";
import { useState } from "react";
import { User } from "./models";

export const SignUp = () => {
  const classes = useStyles();

  setBodyColor({ color: "#DDFFF7" });

  const [user, setUser] = useState<User>(null);

  const handleFirstname = (value) => {
    setUser({ ...user, firstname: value });
  };

  const handleLastname = (value) => {
    setUser({ ...user, lastname: value });
  };

  const handleEmail = (value) => {
    setUser({ ...user, email: value });
  };

  const handlePassword = (value) => {
    setUser({ ...user, password: value });
  };

  const handleAddress = (value) => {
    setUser({ ...user, address: value });
  };

  return (
    <div>
      <Header />
      <Paper elevation={2} className={classes.form}>
        <h1 className={classes.title}>Registration form</h1>
        <Stack spacing={2} direction="row" className={classes.formContainer}>
          <Stack spacing={2} direction="column">
            <TextInput label="Firstname" />
            <TextInput label="Lastname" />
            <TextInput label="Email" type="email" />
            <TextInput label="Password" type="password" />
          </Stack>
          <Stack spacing={2} direction="column">
            <TextInput label="Address" />
            <InputFile accept="image/*" />
          </Stack>
        </Stack>
        <Stack
          className={classes.submitButtonStack}
          spacing={2}
          direction="row"
          justifyContent="center"
        >
          <ButtonClick
            type="submit"
            variant="contained"
            backgroundColor="#FFA69E"
            size="large"
          >
            Sumbit
          </ButtonClick>
        </Stack>
      </Paper>
    </div>
  );
};

const useStyles = makeStyles({
  title: {
    display: "flex",
    justifyContent: "center",
  },
  form: {
    width: "600px",
    margin: "auto",
    marginTop: "150px",
    padding: "60px",
  },
  formContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  submitButtonStack: {
    marginTop: "12px",
  },
});
